import React from "react";

const GreatOperationButton = () => {
	return (
		<div className="GreatOperationButton">
			<button>+</button>
			<button>-</button>
			<button>*</button>
			<button>/</button>
			<button>.</button>
		</div>
	);
};

export default GreatOperationButton;
